export const CategoryItem = ({category}) => {
    const {name, img} = category;
    return (
    <div className='category-container'>
        {name}
        <div className='background-image' style={{backgroundImage:`url(${img})`}}>
            <div className='checkout-text'>
                <h1>Browse</h1>
            </div>
        </div>

    </div>)
}
